import React from "react";
import { useParams } from "react-router";

const Namecompo = () => {
  const { id} = useParams();
  console.log(id);
  const students = [
    { id: 1, name: "Harshita" },
    { id: 2, name: "janaki" },
    { id: 3, name: "Lalsa" },
    { id: 4, name: "manikumar" },
    { id: 5, name: "Karthik" },
  ];
  return (
    <>
      <div>Namecompo</div>
      <h4>Name of the students is{
          students.filter((val,index)=> val.id == id
          )
          }</h4>
    </>
  );
};

export default Namecompo;
